import React from 'react'

interface Props {
    todoList : [],
    setTodoList : React.Dispatch<React.SetStateAction<Todos[]>>
}

const TodoListView:React.FC<Props> = ({todoList, setTodoList}: Props) => {
  return (
    <div>
      {/* {
        todoList.map((e:any) => {
          return(<li>{e.name}</li>)
        })
      } */}
    </div>
  )
}

export default TodoListView
